class Solution:
    def minNumberOperations(self, target) -> int:
        target.append(0)
        n = len(target)
        result = 0
        right_low = 0
        peek = 0
        i = 1
        while i < n:
            while i < n and target[i] >= target[i - 1]:
                i += 1
            peek = target[i - 1]
            while i < n and target[i] <= target[i - 1]:
                i += 1
            right_low = target[i - 1]
            result += peek - right_low
        return result

